import { IoIosSearch } from 'react-icons/io'
import { useState } from 'react'
import { debounce } from 'lodash'
export default function SearchBox({setDebounceSearch}) {
    const searchHelper = (e) => console.log(e.target.value)
    return(
        <div className='flex no-wrap h-8 w-2/6 border border-black m-5'>
            <IoIosSearch className='w-8 my-auto'/>
            <input className='w-full outline-none' name='search' placeholder='Search Everywhere' onChange={event => _.debounce(searchHelper(e), 3000)}/>
        </div>
    )
}
